import React, { useState, useEffect } from "react";
import APIStored from "./APIStored";

function TestingAPI() {
  const [data, setdata] = useState([]);

  useEffect(() => {}, []);
  APIStored()
    .then((response) => {
      setdata(response.data);
    })
    .catch(console.error("Error"));

  console.log(data);
  return (
    <div>
      <table>
        <thead>
          <tr>
            <tr>ID</tr>
            <tr>First Name</tr>
            <tr>Last Name</tr>
            <tr>password</tr>
            <tr>Mobile</tr>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => {
            <tr key={item.id}>
              <tr>{item.first_Name}</tr>
              <tr>{item.last_Name}</tr>
              <tr>{item.email}</tr>
              <tr>{item.password}</tr>
              <tr>{item.mobile}</tr>
            </tr>;
          })}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;
